import React, { Component } from "react";
class Like extends Component {
  render() {
    return (
      <i
        onClick={() => this.props.onLike()}
        className={this.props.liked === true ? "fa fa-heart" : "fa fa-heart-o"}
        aria-hidden="true"
        style={{ cursor: "pointer" }}
      ></i>
    );
  }
}

export default Like;
